      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵtext"](24, " Bilet Antalya Sat\u0131\u015F Politikalar\u0131 ( Kullan\u0131m Ko\u015Fullar\u0131 ve Sat\u0131\u015F S\u00F6zle\u015Fmesi ) ");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵelementEnd"]();
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵelement"](25, "br");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵtext"](26, " 6563 say\u0131l\u0131 Elektronik Ticaretin D\u00FCzenlenmesi Hakk\u0131nda Kanun\u2019un (\u201CKanun\u201D) 3 \u00FCnc\u00FC maddesi uyar\u0131nca, Bilet Antalya ile ilgili tan\u0131t\u0131c\u0131 bilgilerin t\u00FCm\u00FC, sitemizin \u201CHakk\u0131m\u0131zda\u201D ba\u015Fl\u0131kl\u0131 b\u00F6l\u00FCm\u00FCnde g\u00FCncel \u015Fekilde yer almaktad\u0131r. Bilet Antalya olarak hedefimiz; biletinizi en k\u0131sa s\u00FCrede, en kolay \u015Fekilde sat\u0131n alman\u0131z\u0131 sa\u011Flamakt\u0131r. A\u015Fa\u011F\u0131daki Sat\u0131\u015F Politikam\u0131z\u0131 ve Sat\u0131\u015F S\u00F6zle\u015Fmemizi, m\u00FC\u015Fteri olarak sizi memnun k\u0131lacak ve biletantalya.com da sat\u0131n al\u0131m s\u00FCreci konusunda sizi bilgilendirecek \u015Fekilde tasarlad\u0131k. Bu Sat\u0131\u015F Politikas\u0131 ve S\u00F6zle\u015Fmemiz, Kullan\u0131m Ko\u015Fullar\u0131m\u0131z\u0131n da bir b\u00F6l\u00FCm\u00FCn\u00FC olu\u015Fturur. Web sitemize \u00FCye olarak ve/veya bilet al\u0131m i\u015Flemlerini ger\u00E7ekle\u015Ftirerek, Kullan\u0131m Ko\u015Fullar\u0131n\u0131, Sat\u0131\u015F Politikas\u0131 ve S\u00F6zle\u015Fme h\u00FCk\u00FCmlerini ve Gizlilik Beyan\u0131n\u0131 okudu\u011Funuzu, anlad\u0131\u011F\u0131n\u0131z\u0131 ve i\u00E7eriklerini aynen kabul etmi\u015F say\u0131laca\u011F\u0131n\u0131z\u0131 belirtir, sat\u0131\u015F politikas\u0131 ve/veya s\u00F6zle\u015Fme h\u00FCk\u00FCmlerinin aksine bir talebinizin ya da \u015Fikayetinizin olmas\u0131 durumunda, herhangi bir bilet al\u0131m i\u015Flemi ger\u00E7ekle\u015Ftirmeden ve sipari\u015Finizi onaylamadan \u00F6nce, bizimle sitemizde belirtilen ileti\u015Fim numaralar\u0131ndan ileti\u015Fime ge\u00E7menizi \u00F6neririz. Sitemizden bilet sat\u0131n alarak ve sipari\u015Finizi onaylayarak, i\u015Fbu S\u00F6zle\u015Fme h\u00FCk\u00FCmlerine ba\u011Fl\u0131 oldu\u011Funuzu kabul etmektesiniz. Dolay\u0131s\u0131 ile sitemizden bilet sat\u0131n ald\u0131\u011F\u0131n\u0131zda, tur/ etkinlik biletleri ile ilgili t\u00FCm s\u00FCrece, prosed\u00FCrlere ve i\u015Flemlere a\u015Fa\u011F\u0131da yer alan S\u00F6zle\u015Fme h\u00FCk\u00FCmlerinin aynen uygulanaca\u011F\u0131n\u0131 \u00F6nemle belirtiriz.");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵelement"](27, "br")(28, "br");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵtext"](29, " Ayr\u0131ca, sipari\u015Finizi onaylayarak; bileti sat\u0131n almadan \u00F6nce; *gerekli t\u00FCm bilgileri ve ileti\u015Fim adreslerini * sat\u0131n ald\u0131\u011F\u0131n\u0131z bilete ve hizmete ili\u015Fkin t\u00FCm \u00F6zellikleri ve ayr\u0131ca t\u00FCm vergiler dahil toplam bilet/hizmet fiyat\u0131n\u0131 *\u00D6deme bilgileri *Mesafeli S\u00F6zle\u015Fmeler Y\u00F6netmeli\u011Fi\u2019nin 15 (g) maddesine istinaden cayma hakk\u0131n\u0131z\u0131n olmad\u0131\u011F\u0131n\u0131 ve neticeten s\u00F6zle\u015Fmede d\u00FCzenlenen t\u00FCm h\u00FCk\u00FCmleri bildi\u011Finizi yaz\u0131l\u0131 olarak kabul, beyan ve taahh\u00FCt etmektesiniz. Sipari\u015Flerinizi onaylamadan \u00F6nce, sizlerden onay\u0131n\u0131z kapsam\u0131nda, yaz\u0131l\u0131 \u015Fekilde \u00F6n bilgilendirme onay\u0131 al\u0131nd\u0131\u011F\u0131n\u0131 ve \u00F6n bilgilendirme onay\u0131n\u0131n i\u015Fbu S\u00F6zle\u015Fmenin ayr\u0131lmaz bir par\u00E7as\u0131 oldu\u011Funu ayr\u0131ca ve \u00F6nemle vurgular\u0131z. \u0130laveten, i\u015Fbu s\u00F6zle\u015Fme ve \u00F6n onay ile \u201Cbilet sat\u0131n alma sipari\u015Finizin onaylanmas\u0131 durumunda \u00F6deme y\u00FCk\u00FCml\u00FCl\u00FC\u011F\u00FC alt\u0131na girece\u011Finiz\u201D konusunda a\u00E7\u0131k ve anla\u015F\u0131l\u0131r \u015Fekilde bilgilendirildi\u011Finizi de \u00F6nemle bilmenizi isteriz. ");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵelement"](30, "br")(31, "br");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵtext"](32, " Bilet ile \u0130lgili \u015Eart ve Ko\u015Fullar");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵelement"](33, "br")(34, "br");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵtext"](35, " 1-Bilet Antalya, yetkili bilet sat\u0131\u015F acentesi olarak, biletini sat\u0131n ald\u0131\u011F\u0131n\u0131z turu /etkinli\u011Fi d\u00FCzenleyen \u201Corganizat\u00F6r, etkinlik mekan\u0131, kul\u00FCp veya tiyatrolar\u201D( \u201CEtkinlik Organizat\u00F6r\u00FC\u201D) ad\u0131na bilet satar, ancak bilet fiyatlar\u0131n\u0131 veya oturma yerlerini belirleme konusunda hak ve yetkiye sahip de\u011Fildir. Ayr\u0131ca Organizasyon firmas\u0131 etkinlik / tur i\u00E7in uygun g\u00F6rmedi\u011Fi ki\u015Fileri, bilet \u00FCcretini iade ederek etkinlik mekan\u0131na almama hakk\u0131na sahiptir. \u0130\u015Fletme genel kurallar\u0131 i\u00E7erisinde giri\u015F \u2013 \u00E7\u0131k\u0131\u015F i\u015Flemi yapmaktad\u0131r. ");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵelement"](36, "br")(37, "br");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵtext"](38, " 2-Biletler, internet, \u00E7a\u011Fr\u0131 merkezi, gibi \u00E7e\u015Fitli noktalar arac\u0131l\u0131\u011F\u0131yla sat\u0131l\u0131r. T\u00FCm sat\u0131\u015F kanallar\u0131 ayn\u0131 biletleme havuzuna eri\u015Fti\u011Finden pop\u00FCler etkinliklerde biletler h\u0131zl\u0131 bir \u015Fekilde t\u00FCkenebilir. Baz\u0131 durumlarda etkinlikten \u00F6nce Etkinlik /Tur Organizat\u00F6r\u00FC\u2019n\u00FCn karar\u0131 ile ilave bilet sat\u0131\u015Fa \u00E7\u0131kar\u0131labilir ancak bu kapasite veya bilet mevcudiyeti konusunda herhangi bir kontrol g\u00FCc\u00FCne sahip bulunmamakla birlikte bu kapsamda herhangi bir garanti de veremeyece\u011Fimizi belirtiriz. ");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵelement"](39, "br")(40, "br");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵtext"](41, " 3-Etkinlik / Tur Organizat\u00F6r\u00FC \u00E7e\u015Fitli sebeplerle etkinlikleri/ turlar\u0131 iptal edebilir veya tarihlerini de\u011Fi\u015Ftirebilir. Bu durumda uygulanacak prosed\u00FCr\u00FC organizat\u00F6r belirler ve duyurur. Etkinli\u011Fin/turun iptal edilmesinden ve/veya tarihinin de\u011Fi\u015Ftirilmesinden Bilet Antalya sorumlu olmay\u0131p, Organizat\u00F6r sorumludur. Bir turun/etkinli\u011Fin iptal edilmesi veya tarihinin de\u011Fi\u015Ftirilmesi durumunda Etkinlik Organizat\u00F6r\u00FC'nden gerekli yetkiyi almam\u0131z \u015Fart\u0131na ba\u011Fl\u0131 olarak bilet hamillerini s\u00F6z konusu iptalden veya de\u011Fi\u015Fiklikten haberdar etmek i\u00E7in makul gayreti g\u00F6sterece\u011Fiz. ");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵelement"](42, "br")(43, "br");
      _angular_core__WEBPACK_IMPORTED_MODULE_7__["ɵɵtext"](44, " 4-Kural olarak, t\u00FCm bilet sat\u0131\u015Flar\u0131 kesindir. Mesafeli S\u00F6zle\u015Fmeler Y\u00F6netmeli\u011Fi\u2019nin 15 (g) maddesine istinaden sat\u0131n ald\u0131\u011F\u0131n\u0131z biletlere dair cayma hakk\u0131n\u0131z bulunmamaktad\u0131r. Etkinli\u011Fin / turun iptali veya ertelenmesi durumunda, Etkinlik Organizat\u00F6r\u00FC geri \u00F6deme \u015Fartlar\u0131 konusunda baz\u0131 s\u0131n\u0131rland\u0131rmalar getirebilme hakk\u0131na sahip oldu\u011Fu gibi, programda de\u011Fi\u015Fiklik yapma hakk\u0131na da sahiptir. Bu kapsamda Bilet Antalya hi\u00E7bir sorumluluk \u00FCstlenmez. ");
